綿無地の定番中の定番。<br>
適度に薄手でやや粗めのため、針のとおりもよくパッチワークに最適。<br>
しわになりやすいので、お洗濯は弱水流で。色落ちにも気をつけることが必要。<br><br>

表示価格は10cmあたり（税込）です。<br>
通常、最短50cmより、10cm単位で販売しております。<br>
＜数量入力例＞　60cm→数量「6」、1m50cm→数量「15」<br><br>

◆幅：約110cm<br>
◆素材：綿100％<br>
◆日本製<br><br>

※お客様のご注文数によりカットされた生地は再販売不能となりますので、<br>
　　不良品、商品違い以外のお客様都合での返品はお受けできません。<br>
　　あらかじめご了承の上、ご注文ください。<br>
